function Scrabble() {

    let btn = document.getElementById('scrabbleBtn');

    function change() {
        btn.style.backgroundColor = 'red'
    }

    return (
        <div>
            <button id='scrabbleBtn' onClick={change}>
                Hi
            </button>
        </div>
    )
}

export default Scrabble
